class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        
        hay_len = len(haystack)
        needle_len = len(needle)

        if needle_len == 0:
            return 0
        
        if hay_len < needle_len:
            return - 1
        
        if hay_len == needle_len:
            start = -1
            for i in range(hay_len):
                if haystack[i] == needle[i] and start == -1:
                    start = i
                elif haystack[i] != needle[i]:
                    return -1
            
            return start
        
        for i in range(hay_len):
            if haystack[i] == needle[0]:
                c = 0
                valid = True
                while c < needle_len and i+c < hay_len:
                    if haystack[i+c] != needle[c]:
                        valid = False
                        break
                    c += 1
                
                if valid and c == needle_len:
                    return i
        
        return -1


